import React from 'react'
import './TopNav.css'

class TopNav extends React.Component {
    render(){
        return(

                <div className="row" style={{padding:'10px', backgroundColor:'black', color:'white'}}>
                    <div className="col-sm-3">LOGO [App Name]<sub>beta</sub></div>
                    <div className="col-sm-3"><Link to="/playfield">Audio Field</Link></div>
                    <div className="col-sm-3"></div>
                    <div className="col-sm-3" align="right"><button style={{border:'0px', color:'inherit', backgroundColor:'transparent'}}>My Profile</button></div>
                </div>

        )
    }

}
export default TopNav;
